import Carousel from 'react-bootstrap/Carousel';
import Calistenia from "../img/ImgActivities/Calistenia.jpg";
import Crossfit from "../img/ImgActivities/CROSSFIT.jpg";
import Funcional from "../img/ImgActivities/FUNCIONAL.jpg";

function CarouselFadeExample() {
  return (
    <Carousel fade>
      <Carousel.Item>
        <img
          className="d-block"
          src={Calistenia}
          alt="First slide"
          style={{
            height: '50vw',
            width: '90vw',
            objectFit: 'cover'
          }}
        />
        <Carousel.Caption>
          <h3>Calistenia</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block"
          src={Funcional}
          alt="Second slide"
          style={{
            height: '50vw',
            width: '90vw',
            objectFit: 'cover'
          }}
        />

        <Carousel.Caption>
          <h3>Funcional</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block"
          src={Crossfit}
          alt="Third slide"
          style={{
            height: '50vw',
            width: '90vw',
            objectFit: 'cover'
          }}
        />

        <Carousel.Caption>
          <h3>Third slide label</h3>
          <p>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default CarouselFadeExample;
